import React from "react";

const HomeScreen = () => {
  return (
    <>
      <div className="bg-darkgray h-20 w-full z-10"></div>
      <div className="flex">
        <div className="bg-gray w-1/5 h-100"></div>
        <div className="bg-white w-4/5 h-100"></div>
      </div>
      <div className="text-3xl text-red-500 text-center">home</div>
    </>
  );
};

export default HomeScreen;
